import React from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';
import { Redirect } from 'react-router';
class AdminPage  extends React.Component {
  constructor(props) {
   	super(props);
     	this.state = {
          	id: -1,
      		name:"Nothing",
      		con:false,
      		Usersdata:[],
      		iddata:[],
    	};
    	if(props.location.state == null){
        	alert("edw1")
    		this.state.con=false	
    	}
    	else{
        	alert("2")
    		this.state.con=true
    	}
    }
    getData(){
    	alert('edw')
    	axios.post('http://127.0.0.1:8000/users/GetUsers/', {headers: {'Content-Type': 'application/json'}})
        .then(response => {
          this.setState({Usersdata: response.data});
          alert(this.state.Usersdata)
        }).catch(error => {
            alert("Something went wrong")
        })
        axios.post('http://127.0.0.1:8000/users/GetId/', {headers: {'Content-Type': 'application/json'}})
        .then(response => {
          this.setState({id: response.data});
          alert(this.state.id)
        }).catch(error => {
            alert("Something went wrong")
        })
        this.setState({name:"Other"});
    }
    render() {
    	if(this.state.con === false){
  			return (<Redirect to='/'/>);
  		}
		else{
			this.getData()
  			const products = ['orange', 'apple', 'watermelon'];
  			const list = []
			for (const [i, product] of this.state.Usersdata.entries()) {
			    list.push( <Link to="/Register">{products}</Link>)
			    list.push(<br/>)
			}
			return(
			<div>
				<h1>Admin  Page</h1>
				{list}
			</div> 
			)
		}
    }
}

export default AdminPage;
